  "text" : "\"\uB9C8\uC9C0\uB9C9\uC73C\uB85C, \uC800\uB294 \uC5EC\uB7EC\uBD84\uC5D0\uAC8C \uC9C4\uC815\uD55C \uD5D0\uB9AC\uC6B0\uB4DC\uC2DD \uD574\uD53C \uC5D4\uB529\uC774 \uC788\uAE38 \uBC14\uB78D\uB2C8\uB2E4. \uC5EC\uB7EC\uBD84\uC774 \uD2F0\uB809\uC2A4\uBCF4\uB2E4 \uBE68\uB9AC \uB2EC\uB9AC\uACE0, \uBC94\uC8C4\uC790\uB97C \uC7A1\uACE0, \uC5EC\uB7EC\uBD84\uC758 \uBD80\uBAA8\uB2D8\uC744 \uC704\uD574 \uAC00\uB054\uC529 E.T.\uCC98\uB7FC \uC9D1\uC5D0 \uAC00\uC2DC\uAE38 \uBC14\uB78D\uB2C8\uB2E4. \uAC10\uC0AC\uD569\uB2C8\uB2E4.\"",
