  "text" : "\"\uC65C\uB0D0\uD558\uBA74 \uC624\uB298\uBD80\uD130 \uC5EC\uB7EC\uBD84\uC740 \uB2E4\uC74C \uC138\uB300\uAC00 \uC62C\uB77C\uC124 \uAE30\uBC18\uC778 \uC138\uB300\uAC00 \uB418\uB294 \uAE38\uC744 \uAC78\uC744 \uAC83\uC774\uAE30 \uB54C\uBB38\uC785\uB2C8\uB2E4. \uADF8\uB9AC\uACE0 \uB098\uB294 \uC601\uD654\uB4E4\uC5D0\uC11C \uC5EC\uB7EC \uAC00\uC9C0 \uBBF8\uB798\uC758 \uBAA8\uC2B5\uB4E4\uC744 \uC0C1\uC0C1\uD574 \uBCF4\uC558\uC9C0\uB9CC, \uC2E4\uC81C \uBBF8\uB798\uB294 \uC5EC\uB7EC\uBD84\uC774 \uACB0\uC815\uD569\uB2C8\uB2E4. (\uC774\uC5B4\uC11C)\"",
