  "text" : "\"\uD558\uC9C0\uB9CC \uC5EC\uB7EC\uBD84\uC774 \uC624\uB298\uC758 \uC77C \uC911 \uB2E8 \uD55C \uAC00\uC9C0\uB9CC\uC744 \uAE30\uC5B5\uD55C\uB2E4\uBA74, \uB098\uB294 \uC5EC\uB7EC\uBD84\uC774 \uC778\uAC04\uACFC \uC5F0\uACB0\uB418\uC5C8\uB358 \uC9C0\uAE08 \uC774 \uC21C\uAC04\uC744 \uAE30\uC5B5\uD558\uAE38 \uBC14\uB78D\uB2C8\uB2E4. \uADF8\uB9AC\uACE0 \uC5EC\uB7EC\uBD84 \uBAA8\uB450\uAC00 \uC9C0\uB09C 4\uB144 \uB3D9\uC548 \uC778\uAC04\uACFC\uC758 \uC5F0\uACB0\uC744 \uB9CE\uC774 \uAC00\uC84C\uAE38 \uBC14\uB78D\uB2C8\uB2E4. (\uC774\uC5B4\uC11C)\"",
