  "text" : "\"(\uC911\uB7B5)\uBAA8\uB450\uB4E4 \uBAA8\uB974\uB294 \uC0AC\uB78C\uC774\uB098 \uC798 \uBAA8\uB974\uB294 \uC0AC\uB78C\uC744 \uCC3E\uC73C\uC138\uC694. \uB4A4\uC5D0 \uC788\uB294 \uC0AC\uB78C\uB3C4 \uC88B\uACE0, \uBA87 \uC904 \uC55E\uC758 \uC0AC\uB78C\uB3C4 \uC88B\uC2B5\uB2C8\uB2E4. \uADF8\uB0E5 \uB208\uC744 \uB9C8\uC8FC\uCE58\uC138\uC694. \uBC14\uB85C \uADF8\uAC81\uB2C8\uB2E4. \uC5EC\uB7EC\uBD84\uC774 \uC9C0\uAE08 \uB290\uB07C\uACE0 \uC788\uB294 \uAC10\uC815\uC774 \uC57D\uAC04\uC758 \uC0AC\uAD50\uC801 \uBD88\uD3B8\uD568\uC774 \uC11E\uC778, \uC6B0\uB9AC\uAC00 \uACF5\uC720\uD558\uB294 \uC778\uAC04\uC131\uC785\uB2C8\uB2E4.\"",
