  "text" : "\"\uADC0 \uAE30\uC6B8\uC5EC \uADF8 \uC678\uCE68\uC744 \uB4E3\uC9C0 \uC54A\uB294 \uC0AC\uB78C\uB4E4\uC744 \uC704\uD574 \uBAA9\uC18C\uB9AC\uB97C \uB192\uC774\uC138\uC694. \uC5EC\uB7EC\uBD84\uC758 \uC591\uC2EC\uC744 \uB0A8\uB4E4\uC744 \uC704\uD574 \uC0AC\uC6A9\uD560 \uB54C, \uC591\uC2EC\uC774 \uC6D0\uD558\uB294 \uB300\uB85C \uD06C\uAC8C \uC678\uCE58\uAC8C \uD558\uC2ED\uC2DC\uC624.\"",
