  "text" : "\"\uD558\uC9C0\uB9CC \uC774\uB7F0 \uACF5\uAC10\uC744 \uB290\uB07C\uB294 \uAC83\uB9CC\uC73C\uB85C \uADF8\uCE58\uC9C0 \uC54A\uB3C4\uB85D \uD558\uC2ED\uC2DC\uC624. \uC774\uB7F0 \uACF5\uAC10\uC5D0 \uAE30\uBC18\uD574 \uD589\uB3D9\uD558\uC2ED\uC2DC\uC624. \uD22C\uD45C\uB97C \uD558\uB77C\uB294 \uB73B\uC785\uB2C8\uB2E4. \uD3C9\uD654\uB86D\uAC8C \uC2DC\uC704\uD558\uC2ED\uC2DC\uC624. \uBAA9\uC18C\uB9AC\uB97C \uB192\uC77C \uC218 \uC5C6\uB294 \uC0AC\uB78C\uB4E4\uC744 \uC704\uD574 \uBAA9\uC18C\uB9AC\uB97C \uB192\uC774\uACE0, (\uC774\uC5B4\uC11C)\"",
