  "text" : "\"\uB354 \uB9CE\uC740 \uC99D\uC624\uC5D0 \uB300\uD55C \uC720\uC77C\uD55C \uB300\uB2F5\uC740 \uB354 \uB9CE\uC740 \uC778\uAC04\uC131\uC774\uB77C\uACE0 \uC0DD\uAC01\uD569\uB2C8\uB2E4. \uC6B0\uB9AC\uB294 \uACE0\uCCD0\uC57C \uD569\uB2C8\uB2E4. \uACF5\uD3EC\uB97C \uD638\uAE30\uC2EC\uC73C\uB85C \uB300\uCCB4\uD574\uC57C \uD569\uB2C8\uB2E4. \u2018\uC6B0\uB9AC\u2019\uC640 \u2018\uADF8\uB4E4\u2019. \uC6B0\uB9AC\uB294 \uC11C\uB85C\uC640 \uC5F0\uACB0\uB418\uBA70 \u2018\uC6B0\uB9AC\u2019\uB97C \uCC3E\uC744 \uAC83\uC785\uB2C8\uB2E4. (...)\uADF8\uB9AC\uACE0 \uBAA8\uB4E0 \uC0AC\uB78C\uB4E4\uACFC \uACF5\uAC10\uC744 \uB290\uB07C\uBA74\uC11C.\"",
