  "text" : "\"\uC0C1\uC0C1\uC870\uCC28 \uD560 \uC218 \uC5C6\uB294 \uC77C\uC740 \uADF8\uB0E5\uB3C4 \uC544\uB2C8\uACE0 \uC790\uC8FC \uC77C\uC5B4\uB09C\uB2E4\uB294 \uC0AC\uC2E4\uC744 \uC78A\uC5B4\uC11C\uB294 \uC548\uB418\uAE30 \uB54C\uBB38\uC785\uB2C8\uB2E4. \uC794\uD639 \uD589\uC704\uB294 \uBC14\uB85C \uC9C0\uAE08\uB3C4 \uC77C\uC5B4\uB098\uACE0 \uC788\uC2B5\uB2C8\uB2E4.  (\uC774\uC5B4\uC11C)\"",
