  "text" : "\"\uC774 \uC138\uACC4\uC5D4 \uAD34\uBB3C\uB4E4\uC774 \uAC00\uB4DD\uD569\uB2C8\uB2E4. \uADF8\uB9AC\uACE0 \uC778\uC885\uCC28\uBCC4, \uB3D9\uC131\uC560 \uD610\uC624, \uBBFC\uC871\uAC04\uC758 \uC99D\uC624, \uACC4\uAE09\uAC04\uC758 \uC99D\uC624, \uC815\uCE58\uC801 \uC99D\uC624, \uC885\uAD50\uC801 \uC99D\uC624\uAC00 \uC788\uC9C0\uC694.\"",
