  "text" : "\"\uC0AC\uB791, \uC9C0\uC6D0, \uC6A9\uAE30, \uC9C1\uAD00. \uC774 \uBAA8\uB4E0 \uAC83\uB4E4\uC740 \uC601\uC6C5\uC778 \uC5EC\uB7EC\uBD84\uC758 \uD654\uC0B4\uD1B5\uC5D0 \uB4E4\uC5B4 \uC788\uC2B5\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uC601\uC6C5\uC5D0\uAC8C\uB294 \uD55C \uAC00\uC9C0\uAC00 \uB354 \uD544\uC694\uD569\uB2C8\uB2E4. \uBB34\uCC0C\uB97C \uC545\uB2F9\uC774 \uD544\uC694\uD558\uC8E0. \uC5EC\uB7EC\uBD84\uC740 \uC6B4\uC774 \uC88B\uC2B5\uB2C8\uB2E4. (\uC774\uC5B4\uC11C)\"",
