  "text" : "\"\uB2F9\uC2E0\uC774 \uACB0\uC815\uD558\uB294 \uC21C\uAC04\uC5D0, \uD3B8\uB9AC\uD568\uC774\uB098 \uD615\uD3B8 \uB54C\uBB38\uC5D0 \uB3C4\uB355\uC774 \uD754\uB4E4\uB9AC\uAC8C \uD558\uC9C0 \uB9C8\uC2ED\uC2DC\uC624. \uB2F9\uC2E0\uC758 \uCE90\uB9AD\uD130\uB97C \uACE0\uC218\uD558\uB294 \uB370\uB294 \uB9CE\uC740 \uC6A9\uAE30\uAC00 \uD544\uC694\uD569\uB2C8\uB2E4. \uADF8\uB9AC\uACE0 \uC6A9\uAE30\uB97C \uAC00\uC9C0\uB824\uBA74 \uB3C4\uC6C0\uC744 \uB9CE\uC774 \uBC1B\uC544\uC57C \uD560 \uAC83\uC785\uB2C8\uB2E4.\"",
