  "text" : "\"\uC544\uC774\uB4E4\uC774 \uC790\uC2E0\uC774 \uB204\uAD70\uC9C0\uB97C \uC774\uD574\uD558\uB294 \uAC83\uC740 \uACE7 \uBD80\uBAA8\uAC00 \uB204\uAD6C\uC600\uB294\uC9C0, \uC870\uBD80\uBAA8\uAC00 \uB204\uAD6C\uC600\uB294\uC9C0, \uADF8\uB9AC\uACE0 \uADF8\uB4E4\uC774 \uC774 \uB098\uB77C\uC5D0 \uCC98\uC74C \uC774\uBBFC \uC654\uC744 \uB54C \uC774 \uB098\uB77C\uAC00 \uC5B4\uB560\uB294\uC9C0\uB97C \uC774\uD574\uD558\uB294 \uAC83\uC774\uB2C8\uAE4C\uC694. \uC6B0\uB9AC \uBBF8\uAD6D\uC740 \uC774\uBBFC\uC790\uB4E4\uC758 \uB098\uB77C\uC785\uB2C8\uB2E4. \uC801\uC5B4\uB3C4 \uC9C0\uAE08\uC740 \uADF8\uB807\uC9C0\uC694.\"",
