  "text" : "\"\uC6B0\uB9AC\uAC00 \uD479 \uBE60\uC838 \uC9C0\uB0B4\uB294 \uC18C\uC15C \uBBF8\uB514\uC5B4\uB294 \uC9C0\uAE08 \uC5EC\uAE30\uC5D0 \uB300\uD55C \uAC81\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uB098\uB294 \uB0B4 \uAC00\uC871 \uC548\uC5D0\uC11C \uACC4\uC18D\uD574\uC11C \uC2F8\uC6B0\uACE0 \uC788\uC5B4\uC694. \uC544\uC774\uB4E4\uC744 \uBAA8\uB450 \uACFC\uAC70\uB97C \uBCF4\uAC8C \uD558\uB3C4\uB85D, \uC5B4\uB5A4 \uC77C\uC774 \uC774\uC81C\uAE4C\uC9C0 \uC77C\uC5B4\uB0AC\uB294\uC9C0 \uBCF4\uAC8C \uD558\uAE30 \uC704\uD574\uC11C\uC8E0 (\uC774\uC5B4\uC11C)\"",
