  "text" : "\"\uADF8\uB9AC\uACE0 \uB354 \uB098\uC740 \uBBF8\uB798\uB97C \uB9CC\uB4DC\uB294 \uBC29\uBC95\uC740 \uACFC\uAC70\uB97C \uACF5\uBD80\uD558\uB294 \uAC83\uC785\uB2C8\uB2E4. \u2018\uC96C\uB77C\uAE30 \uACF5\uC6D0\u2019\uC758 \uC6D0\uC791 \uC18C\uC124\uC744 \uC4F4 \uB9C8\uC774\uD074 \uD06C\uB77C\uC774\uD2BC\uC740 (...) \uC790\uC2E0\uC774 \uAC00\uC7A5 \uC88B\uC544\uD558\uB294 \uAD50\uC218\uC758 \uB9D0\uC744 \uC990\uACA8 \uC778\uC6A9\uD588\uC2B5\uB2C8\uB2E4. \uB2F9\uC2E0\uC774 \uC5ED\uC0AC\uB97C \uBAA8\uB974\uBA74 \uB2F9\uC2E0\uC740 \uC544\uBB34\uAC83\uB3C4 \uBAA8\uB974\uB294 \uAC83\uC774\uB2E4.\"",
