  "text" : "\"\uB0B4 \uC9C1\uC5C5\uC740 \uB450 \uC2DC\uAC04 \uB3D9\uC548 \uC9C0\uC18D\uB418\uB294 \uC138\uACC4\uB97C \uB9CC\uB4DC\uB294 \uAC81\uB2C8\uB2E4. \uC5EC\uB7EC\uBD84\uC758 \uC9C1\uC5C5\uC740 \uC601\uC6D0\uD788 \uB0A8\uB294 \uC138\uACC4\uB97C \uB9CC\uB4DC\uB294 \uAC81\uB2C8\uB2E4. \uC5EC\uB7EC\uBD84\uC740 \uBBF8\uB798\uC5D0 \uD601\uC2E0\uC744 \uD558\uACE0, \uB3D9\uAE30 \uBD80\uC5EC\uB97C \uD560 \uAC83\uC774\uBA70, \uC9C0\uB3C4\uC790\uAC00 \uB418\uACE0 \uB0A8\uB4E4\uC744 \uB3CC\uBCFC \uAC83\uC785\uB2C8\uB2E4.\"",
