  "text" : "\"\uC9C1\uAD00\uC740 \uC591\uC2EC\uACFC\uB294 \uB2E4\uB974\uB2E4\uB294 \uAC78 \uBD84\uBA85\uD788 \uB9D0\uD558\uACE0 \uC2F6\uC2B5\uB2C8\uB2E4. \uC9C1\uAD00\uACFC \uC591\uC2EC\uC740 \uD568\uAED8 \uC791\uC6A9\uD558\uC9C0\uB9CC, \uB2E4\uB978 \uC810\uC774 \uC788\uC2B5\uB2C8\uB2E4. \uC591\uC2EC\uC740 \u2018\uB124\uAC00 \uD574\uC57C \uD558\uB294 \uC77C\uC740 \uC774\uAC70\uC57C\u2019\uB77C\uACE0 \uC18C\uB9AC\uCE58\uACE0, \uC9C1\uAD00\uC740 \u2018\uB124\uAC00 \uD560 \uC218 \uC788\uB294 \uC77C\uC740 \uC774\uAC70\uC57C\u2019\uB77C\uACE0 \uC18D\uC0AD\uC785\uB2C8\uB2E4. (\uC774\uC5B4\uC11C)\"",
