  "text" : "\"(\uC774\uC5B4\uC11C) \uB098\uB294 \uD55C\uB3D9\uC548 \uB2E4\uB978 \uC774\uAC00 \uC2DC\uD0A4\uB294 \uB300\uB85C \uB0B4 \uCE90\uB9AD\uD130\uB97C \uACB0\uC815\uD588\uC2B5\uB2C8\uB2E4. \uB0B4\uAC00 \uB0B4 \uC2DC\uAC01\uC744 \uC5B5\uB204\uB974\uACE0 \uC788\uC5C8\uAE30 \uB54C\uBB38\uC774\uC5C8\uACE0, \uD574\uB9AC \uB2D0\uC2A8 \uB178\uB798 \uAC00\uC0AC\uCC98\uB7FC \u2018\uBAA8\uB450 \uB0B4\uAC8C \uB9D0\uC744 \uD574\uC11C, \uB0B4 \uB9C8\uC74C\uC18D\uC758 \uBA54\uC544\uB9AC\uB97C \uB4E4\uC744 \uC218\uAC00 \uC5C6\uC5C8\u2019\uAE30 \uB54C\uBB38\uC774\uC8E0.\"",
