  "text" : "\"\uB0B4\uAC00 \uD558\uACE0 \uC2F6\uC740 \uC77C\uC774 \uBB54\uC9C0 18\uC138\uC5D0 \uC815\uD655\uD788 \uC54C\uACE0 \uC788\uC5C8\uB358 \uC800\uB294 \uC6B4\uC774 \uC88B\uC558\uC2B5\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uB098\uB294 \uB0B4\uAC00 \uB204\uAD6C\uC778\uC9C0 \uBAB0\uB790\uC2B5\uB2C8\uB2E4. \uB2F9\uC5F0\uD558\uC8E0. \uC6B0\uB9AC \uC911 \uADF8 \uB204\uAD6C\uB3C4 \uC54C \uC218 \uC5C6\uC2B5\uB2C8\uB2E4. (\uC774\uC5B4\uC11C)\"",
