  "text" : "\"2\uC2DC\uAC04\uC9DC\uB9AC \uC601\uD654\uC5D0\uC11C\uB294 \uCE90\uB9AD\uD130\uB97C \uACB0\uC815\uD558\uB294 \uC21C\uAC04\uC774 \uBA87 \uBC88 \uC548 \uB098\uC624\uC9C0\uB9CC, \uC2E4\uC81C \uC0B6\uC5D0\uC11C\uB294 \uB9E4\uC77C \uADF8\uB7F0 \uC21C\uAC04\uC744 \uB9CC\uB0A9\uB2C8\uB2E4. \uCE90\uB9AD\uD130\uB97C \uACB0\uC815\uD558\uB294 \uC21C\uAC04\uB4E4\uC774 \uAE38\uAC8C \uC774\uC5B4\uC838 \uC788\uB294 \uAC83\uC774 \uC778\uC0DD\uC785\uB2C8\uB2E4. (\uC774\uC5B4\uC11C)\"",
