  "text" : "\"\uC5EC\uB7EC\uBD84\uC774 \uC9C0\uAE08 \uC120\uD0DD\uD558\uB294 \uD589\uB3D9\uC744 \uC601\uD654\uC5D0\uC11C\uB294 \u2018\uCE90\uB9AD\uD130\uB97C \uACB0\uC815\uD558\uB294 \uC21C\uAC04\u2019\uC774\uB77C\uACE0 \uBD80\uB985\uB2C8\uB2E4. \uC9C0\uAE08 \uC774 \uC21C\uAC04\uC740 \uC5EC\uB7EC\uBD84\uC774 \uC544\uC8FC \uC775\uC219\uD55C \uC21C\uAC04\uC785\uB2C8\uB2E4. \uB9C8\uCE58 \u2018\uC2A4\uD0C0\uC6CC\uC988: \uAE68\uC5B4\uB09C \uD3EC\uC2A4\u2019\uC5D0\uC11C \uB808\uC774\uAC00 \uC790\uC2E0\uC5D0\uAC8C \uD3EC\uC2A4\uAC00 \uC788\uB2E4\uB294 \uAC78 \uAE68\uB2EB\uB294 \uAC83\uACFC \uAC19\uC740 \uC21C\uAC04\uC785\uB2C8\uB2E4. (\uC774\uC5B4\uC11C)\"",
