  "text" : "\uBE44\uC720\uC758 \uC18C\uC7AC\uB294 \uC8FC\uB85C \uC5B4\uB514\uC11C \uACE8\uB77C\uB0B4\uB294 \uAC74\uAC00.\n\uC804\uAC04\uB514: \uC815\uB9D0 \uADF8\uB54C\uADF8\uB54C \uB2E4\uB974\uB2E4. \uC608\uB97C \uB4E4\uC5B4 f(x)\uC758 \u2018\uBBF8\uD589\u2019\uC740 \uB178\uB798\uB97C \uACC4\uC18D \uB4E3\uB2E4 \uBCF4\uB2C8 \uB098\uB3C4 \uBAA8\uB974\uAC8C \u201C\uB09C \uB9C8\uB2C8 \uB9C8\uB2C8\uB610\u201D\uB77C\uACE0 \uD765\uC5BC\uAC70\uB9AC\uACE0 \uC788\uB354\uB77C. (\uC774\uC5B4\uC11C) #\uC5D0\uD504\uC5D1\uC2A4\n https:\/\/t.co\/6DNhlUOA40",
