  "text" : "\uC11C\uC9C0\uC74C: \uBD24\uB358 \uBC18\uC751 \uC911\uC5D0 \uAC00\uC7A5 \uB9C8\uC74C\uC774 \uC544\uD320\uB358 \uAC74 \uD55C\uAE00 \uD30C\uAD34\uB2E4, \uBB38\uBC95 \uD30C\uAD34\uB2E4, \uC774\uB7F0 \uAC83\uB4E4\uC774\uC5C8\uB2E4. \uC774 \uC790\uB9AC\uB97C \uBE4C\uB824 \uBCC0\uBA85\uD574\uBCF4\uC790\uBA74 \uB098\uB294 \uD55C\uAE00\uC744 \uC0AC\uB791\uD558\uACE0, \uCD5C\uB300\uD55C \uBB38\uBC95\uC744 \uD30C\uAD34\uD558\uC9C0 \uC54A\uC73C\uB824\uACE0 \uB178\uB825\uD55C\uB2E4. \uC55E\uC73C\uB85C\uB3C4 \uBB38\uBC95\uC744 \uC9C0\uD0A4\uBA74\uC11C \uC608\uC05C \uD45C\uD604\uB4E4\uC744 \uB9CE\uC774 \uCC3E\uC544\uBCFC \uAC70\uB2E4.",
