  "text" : "\u2018Dumb Dumb\u2019\uC744 \uC0B4\uB824\uC11C \uC4F0\uB2E4 \uBCF4\uB2C8 \uB098\uBA38\uC9C0 \uAD6C\uC808\uC758 \uAC00\uC0AC\uB3C4 \uC790\uC5F0\uC2A4\uB7FD\uAC8C \uB5A0\uC62C\uB790\uB2E4. \uC0AC\uC2E4 \uC791\uC0AC\uB97C \uD560 \uB54C, \uBB54\uAC00 \uC0AC\uB78C\uB4E4 \uBA38\uB9AC\uC5D0 \uB0A8\uC744 \uB9CC\uD55C \uBB38\uAD6C\uB97C \uB123\uAE30 \uC704\uD574 \uB9CE\uC774 \uC758\uC2DD\uD55C\uB2E4. \uAF42\uD788\uB294 \uD6C4\uB834\uAD6C\uB97C \uB9CC\uB4E4 \uB54C\uB294 \uAC1C\uADF8\uB9E8\uB4E4\uC774 \uC720\uD589\uC5B4\uB97C \uB9CC\uB4DC\uB294 \uC2DD\uC758 \uC811\uADFC\uC744 \uD558\uB294 \uAC70\uB2E4.",
