  "text" : "\"\uC139\uC2A4\uC5B4\uD544\uC774 \uAC15\uD55C \uCF58\uC149\uD2B8\uB85C \uB370\uBDD4\uD560 \uACBD\uC6B0 \uC120\uC815\uC801\uC774\uB77C\uB294 \uBE44\uD310\uC744 \uBC1B\uB294 \uAC83\uC740 \uBB3C\uB860, \uC7A0\uC2DC \uD654\uC81C\uAC00 \uB420 \uBFD0 \uC778\uAE30\uB97C \uC5BB\uB294 \uACBD\uC6B0\uB294 \uB9CE\uC9C0 \uC54A\uB2E4. \uC139\uC2DC\uD55C \uCF58\uC149\uD2B8\uB294 \uC774\uB978\uBC14 \u2018\uC2F8 \uBCF4\uC5EC\uC11C\u2019 \uC2EB\uB2E4\uACE0 \uD558\uC9C0\uB9CC, \uC18C\uB140 \uCF58\uC149\uD2B8\uC758 \uC637\uC5D0\uC11C\uB294 \uC5B4\uB5BB\uAC8C\uB4E0 \uC120\uC815\uC801\uC778 \uC21C\uAC04\uC744 \uCC3E\uC73C\uB824 \uD55C\uB2E4.\"",
