  "text" : "SM EDM\uB808\uC774\uBE14 \uC2A4\uD06C\uB9BC \uB808\uCF54\uC988\uB97C \uBCF4\uBA74 1.\uC2B4\uC740 \uC758\uB3C4\uD558\uAC74 \uC758\uB3C4\uD558\uC9C0 \uC54A\uC558\uAC74 \uC5B4\uB5BB\uAC8C \uBE44\uCDB0\uC9C8 \uC9C0 \uCE90\uCE58\uD558\uACE0 \uC788\uB2E4\uB294 \uAC83 2.\uB808\uC774\uBE14\uD654 \uBFD0\uC544\uB2C8\uB77C \uC791\uC5C5\uBC29\uC2DD\uC5D0\uB3C4 \uBCC0\uD654\uAC00 \uC788\uC73C\uBA70 3.\uD574\uC678 \uD504\uB85C\uB4C0\uC11C\uAC00 \uC544\uC2DC\uC544 \uC2DC\uC7A5 \uC9C4\uCD9C\uC744 \uBAA9\uC801\uC73C\uB85C \uC791\uC5C5\uD558\uACE0\uC790 \uD55C\uB2E4\uB294 \uAC83 #IM",
