  "text" : "\"\u201C\uACC4\uD68D\uC740 \uB9CE\uC9C0\uB9CC \uC5B4\uB5BB\uAC8C \uB420\uC9C0\uB294 \uBAA8\uB974\uC8E0.\u201D \uC544\uC9C1\uC740 \uAC00\uB2A5\uC131\uC5D0 \uBB34\uAC8C\uB97C \uC2E4\uC5B4\uB2EC\uB77C\uB294 \uB9D0\uC774\uC5C8\uB2E4. \uADF8\uB140 \uB9D0\uC774 \uB9DE\uC558\uB2E4. \uC544\uC9C1 \uD655\uC2E4\uD55C \uAC74 \uC5C6\uB2E4. \uD55C\uACC4\uC640 \uC7A5\uC810 \uBAA8\uB450 \uC120\uBA85\uD558\uB2E4. \uC774\uC81C \uC2DC\uC791\uC77C \uBFD0\uC774\uB2E4.\"",
