  "text" : "\"\uB9AC\uD585\uC758 \uC12D\uC678 \uBE44\uD558\uC778\uB4DC \uC2A4\uD1A0\uB9AC\uB97C \uBB3B\uB294 \uB3C4\uC911\uC5D0 \uC7AC\uBC0C\uB294 \uC774\uC57C\uAE30\uB97C \uB4E4\uC5C8\uB2E4. \uADF8\uB3C4 \uC801\uADF9\uC801\uC73C\uB85C \uC6D0\uD588\uB2E4\uB294 \uAC83\uC774\uB2E4. \uD604\uC7AC \uB2E4\uB978 EDM \uC2A4\uD0C0\uB4E4\uACFC\uB3C4 \uC791\uC5C5 \uC911\uC778\uB370, \uADF8\uB4E4 \uC5ED\uC2DC \uD558\uB098\uAC19\uC774 \uC801\uADF9\uC801\uC778 \uD0DC\uB3C4\uB77C\uACE0 \uD55C\uB2E4. \uC774\uC720\uAC00 \uBB58\uAE4C. \u201C\uC544\uC2DC\uC544 \uC2DC\uC7A5\uC5D0 \uC9C4\uCD9C\uD558\uACE0 \uC2F6\uAE30 \uB54C\uBB38\u201D\uC774\uB2E4.\"",
