  "text" : "\"3\uCE35\uC758 \uC1A1\uCEA0\uD504 \uC2A4\uD29C\uB514\uC624\uB294 \uD654\uB824\uD55C \uC2DC\uC124\uC744 \uC790\uB791\uD558\uC9C4 \uC54A\uB294\uB2E4. \uB9C8\uC2A4\uD130\uAC74\uBC18, \uB9C8\uC774\uD06C, \uCEF4\uD4E8\uD130, \uC2A4\uD53C\uCEE4 \uC815\uB3C4\uC758 \uAE30\uBCF8\uC801\uC778 \uC138\uD305\uB9CC \uB418\uC5B4 \uC788\uB2E4. \uC231\uD55C \uD558\uB4DC\uC6E8\uC5B4 \uC7A5\uBE44\uB4E4\uC774 \uCD18\uCD18\uD788 \uC7A5\uCC29\uB41C \uC2A4\uD29C\uB514\uC624\uB294 5\uCE35\uC5D0 \uB530\uB85C\uC788\uB2E4. \uC774\uACF3\uC5D0\uC11C \uC5D4\uC9C0\uB2C8\uC5B4\uB4E4\uC774 \uBCF8\uACA9\uC801\uC73C\uB85C \uC0AC\uC6B4\uB4DC\uB97C \uB2E4\uC7A1\uB294\uB2E4.\"",
